import { useState, useEffect } from "react";
import { Link } from 'react-router-dom';

export default function Cars() {
  const [cars, setCars] = useState([]);
  useEffect(() => {
    const getCars = async () => {
      try {
        const res = await fetch('/api/cars');
        const data = await res.json();
        setCars(data.cars);
      } catch(err) {
        throw new Error('Something went wrong');
      }
    }
    getCars();
  }, []);


  const carComponent = cars.map(car => {
    return (
      
      <Link className="car-link">
        <div key={ car.id } className="car-image-container">
          <img src={ car.imageUrl } alt="car avatar" />
          <h3>{ car.name }</h3>
          <div 
             className="type"
             style={{
              background: car.type === 'rugged' ? 
              'cadetblue': car.type === 'flashy' ?
              'orange': car.type === 'top class' ?
              'black': car.type === 'classic' ?
              'indigo': 'yellow'
             }}
          >
            <p>{ car.type }</p>
          </div>
        </div>
      </Link>
    );
  });

  return (
    carComponent
  );
};
